    <div id="modal" class="modal">
      <h2 id="modalTitle"></h2>
      <table id="modalTable"></table>
      <button onclick="closeModal()">Cerrar</button>
    </div>

    <script>
      const sheetUrl =
        "https://script.google.com/macros/s/AKfycbw41TpoqtJuzPhjpqCFbTGF0f5wtb3so7ZdOJYVQFd8EpQeZRc5Gb_swh4D2WR6BOeb/exec";
      let districtData = {};

      async function fetchData() {
        try {
          const response = await fetch(sheetUrl);
          const data = await response.json();
          data.forEach((row) => {
            const district = row["Distrito"];
            if (district) districtData[district] = row;
          });
          createButtons(Object.keys(districtData));
          setupSVGEvents();
        } catch (error) {
          console.error("Error fetching data:", error);
        }
      }

      function createButtons(districts) {
        const container = document.getElementById("buttonsContainer");
        districts.forEach((district) => {
          const button = document.createElement("button");
          button.textContent = district;
          button.onclick = () => openModal(district);
          container.appendChild(button);
        });
      }

      function setupSVGEvents() {
        document.querySelectorAll("svg path").forEach((path) => {
          path.addEventListener("click", () => {
            const district = parseInt(path.id);
            if (districtData[district]) {
              openModal(district);
            } else {
              console.warn("No data found for district:", district);
            }
          });
        });
      }

      function openModal(district) {
        document.getElementById("modalTitle").textContent = district;
        const table = document.getElementById("modalTable");
        table.innerHTML = "";
        const data = districtData[district];
        for (const key in data) {
          if (key !== "Distrito") {
            let row = table.insertRow();
            row.insertCell(0).textContent = ""; // key;
            if (key === "file") {
              row.insertCell(
                1
              ).innerHTML = `<a target="_blank" href=${data[key]} >PDF</a>`;
            } else {
              row.insertCell(1).textContent = data[key];
            }
          }
        }
        document.getElementById("modal").classList.add("active");
      }

      function closeModal() {
        document.getElementById("modal").classList.remove("active");
      }

      fetchData();
    </script>
  </body>
</html>
